import React from 'react';
import Country from './country.js';
import './country.css';
class Data extends React.Component{
    constructor(props){
       super(props)
        this.state={
            dataEl:[]
        }
    }
   async componentDidMount(){
       let response=await fetch('http://restcountries.eu/rest/v2/all');
       let jsonData=await response.json();
       this.setState({
           dataEl:jsonData
       })
   }
    render(){
        return(
        <div className="display-property">{this.state.dataEl.map((data,index)=> <Country country={data} key={index}/> )}</div>        
       )
    }
}
export default Data;
